`,paraId:23,tocIndex:10},{value:"\u53EA\u8981\u5224\u65AD\u6709\u6CA1\u6709 isReactComponent \u5C31\u53EF\u4EE5\u533A\u5206\u662F\u5426\u662F\u51FD\u6570\u5F0F\u7EC4\u4EF6\u4E86\u3002",paraId:24,tocIndex:10},{value:"\u5982\u6B64\u5C31\u6784\u5EFA\u4E86\u4E00\u4E2A\u5BF9 react vdom \u4E8C\u6B21\u5C01\u88C5\u7684 Fiber \u5BF9\u8C61\u3002",paraId:25,tocIndex:10},{value:"\u6211\u4EEC\u90FD\u77E5\u9053\uFF0CReact 17+ \u7684\u6839\u7EC4\u4EF6\u6E32\u67D3\u65B9\u5F0F\uFF1A",paraId:26,tocIndex:11},{value:`// \u65B0\u7684\u6E32\u67D3\u65B9\u5F0F\uFF0C\u5F00\u653E\u51FA\u4E86 root \u5BF9\u8C61\u5355\u4F8B\uFF0C\u65B9\u4FBF\u91CD\u590Drender
