// bind \u5230 null \u4E0A\uFF0C\u662F\u4E3A\u4E86\u8BA9 currentlyRenderingFiber \u66F4\u65B0\uFF0C\u76F4\u63A5\u8C03\u7528 dispatchReducerAction\uFF0C\u5176\u6307\u9488\u6307\u5411\u6CA1\u6709\u53D8\u5316\uFF0C\u6709\u591A\u4E2A\u51FD\u6570\u5F0F\u7EC4\u4EF6\u65F6\uFF0C\u4F1A\u4EA7\u751F\u6E32\u67D3\u9519\u4E71\u3002
